import NoRecord from "../pages/error/Error";
import Home from "../pages/home/Home";
import Login from "../pages/login/Login";
import Dashboard from "../pages/dashboard/Dashboard";

export const GuiRoutes = [
  {
    path: "/login",
    component: Login,
    title: "Login",
  },
  {
    path: "",
    component: Home,
    title: "Home",
  },
  {
    path: "*",
    component: Home,
    title: "Home",
  },
  {
    path: "/dashboard",
    component: Dashboard,
    title: "Dashboard",
  },
];
